    return (
        <View style={{
            height: 80 ,
            backgroundColor:'white',
            flexDirection:'row'
        }}>
        <View style={{
            flex:3,
            
            alignItems:'center',
            
        }}>
        <Entypo style={{
            marginTop:10,
        }} name="location" size={40} color='#1C2348' />
<Text>
Location
</Text>
        </View>
        <View style={{
            flex:3,
            backgroundColor:'red',
        }}>

        </View>
        <View style={{
            flex:3,
            backgroundColor:'green',
        }}>

        </View>
        
        
        </View>
        
    );
}

export default Bottom;
